function generate() {
    const output = document.getElementById("output");
	
	const masaMula = document.getElementById('masa_mula').value;
    const masaTamat = document.getElementById('masa_tamat').value;
    const masaDisplay = (masaMula && masaTamat) ? `${masaMula} - ${masaTamat}` : (masaMula || masaTamat || '-');
	
	const bidang = document.getElementById('bidang').value;
    
    if (bidang === "") {
        alert("Sila pilih Bidang terlebih dahulu!");
        return; // This stops the report from being generated
    }
    
    const content = `
    <div class="report-content" id="report-to-print">
        <table class="header-table">
            <tr>
                <td style="width:20%"><img src="data:image/png;base64," class="logo-img"></td>
                <td style="width:60%">
                    <h3 style="margin:0; font-size:17px;">SEKOLAH MENENGAH KEBANGSAAN BUKIT SENTOSA</h3>
                    <p style="margin:5px 0; font-size:12px;"><b>BANDAR BARU BUKIT SENTOSA, 48300 RAWANG, SELANGOR</b></p>
                </td>
                </tr>
        </table>

        <table class="data-table">
            <tr><td class="label">NAMA PROGRAM</td><td>${document.getElementById('program').value.toUpperCase() || '-'}</td></tr>
            <tr><td class="label">BIDANG</td><td>${document.getElementById('bidang').value.toUpperCase() || '-'}</td></tr>
            <tr><td class="label">TARIKH / MASA</td><td>${document.getElementById('tarikh').value} / ${masaDisplay}</td></tr>
            <tr><td class="label">TEMPAT</td><td>${document.getElementById('tempat').value.toUpperCase() || '-'}</td></tr>
            <tr><td class="label">KEHADIRAN</td><td>${document.getElementById('kehadiran').value.toUpperCase() || '-'}</td></tr>
            <tr><td class="label">JEMPUTAN</td><td>${document.getElementById('jemputan').value.toUpperCase() || '-'}</td></tr>
        </table>

        <div class="section-title">LAPORAN BERGAMBAR</div>
        <div class="images-grid" id="imageContainer"></div>

        <div class="section-title">RINGKASAN AKTIVITI:</div>
        <div class="text-box">${document.getElementById('ringkasan').value || ' '}</div>
		
		<div class="section-title">KEKUATAN:</div>
        <div class="text-box">${document.getElementById('kekuatan').value || ' '}</div>
		
		<div class="section-title">KELEMAHAN:</div>
        <div class="text-box">${document.getElementById('kelemahan').value || ' '}</div>

        <div class="section-title">PENAMBAHBAIKAN:</div>
        <div class="text-box">${document.getElementById('penambahbaikan').value || ' '}</div>

		<table class="sig-table">
		    <tr>
		        <td>
		            <div class="sig-label">DISEDIAKAN OLEH:</div>
		            <div style="height: 50px;"></div> <div style="border-top: 1px solid black; width: 80%; margin: 0 auto;"></div>
		            <div style="font-size: 11px; text-align: center; font-weight: bold; margin-top: 5px;">${document.getElementById('nama1').value.toUpperCase()}</div>
		        </td>
		        <td>
		            <div class="sig-label">DISEMAK OLEH:</div>
		            <div style="height: 50px;"></div> <div style="border-top: 1px solid black; width: 80%; margin: 0 auto;"></div>
		            <div style="font-size: 11px; text-align: center; font-weight: bold; margin-top: 5px;">${document.getElementById('nama2').value.toUpperCase()}</div>
		        </td>
		        <td>
		            <div class="sig-label">DISAHKAN OLEH:</div>
		            <div style="height: 50px;"></div> <div style="border-top: 1px solid black; width: 80%; margin: 0 auto;"></div>
		            <div style="font-size: 11px; text-align: center; font-weight: bold; margin-top: 5px;">${document.getElementById('nama3').value.toUpperCase()}</div>
		        </td>
		    </tr>
		</table>
    </div>`;

    output.innerHTML = content;

    // Process Images
    const files = document.getElementById('gambar').files;
    const imgBox = document.getElementById('imageContainer');
    if (files.length > 0) {
        Array.from(files).slice(0, 6).forEach(file => {
            const reader = new FileReader();
            reader.onload = (e) => {
                const img = document.createElement("img");
                img.src = e.target.result;
                imgBox.appendChild(img);
            };
            reader.readAsDataURL(file);
        });
    }
}

function printReport() {
    const report = document.getElementById("report-to-print");
    
    if (!report) {
        alert("Sila klik 'Jana Laporan' terlebih dahulu!");
        return;
    }

    // Scroll to top so the print view starts correctly
    window.scrollTo(0, 0);

    // Trigger the browser print dialog
    window.print();
}



async function uploadToDrive() {
    // 1. Jana laporan dalam HTML supaya ada kandungan untuk ditangkap
    generate(); 

    // Ambil elemen spesifik yang mengandungi kandungan laporan
    const element = document.getElementById('report-to-print');
    const programName = document.getElementById('program').value || "Laporan_OPR";

    if (!element) {
        alert("Sila isi maklumat dan tekan 'Jana Laporan' terlebih dahulu.");
        return;
    }

    // Paparkan mesej loading (optional)
    console.log("Sedang menyediakan PDF...");

    const opt = {
		margin: 0,
		filename: programName + '.pdf',
		image: { type: 'jpeg', quality: 0.98 },
		html2canvas: { 
			scale: 2, 
			useCORS: true, 
			logging: false,
			scrollX: 0,
			scrollY: 0,
			windowWidth: document.documentElement.offsetWidth, // Guna lebar skrin sebenar
		},
		jsPDF: { unit: 'mm', format: 'a4', orientation: 'portrait' }
	};

    try {
        // 2. Tukar HTML kepada Blob PDF secara asynchronous
        const worker = html2pdf().set(opt).from(element);
        const blob = await worker.outputPdf('blob');
        
        // 3. Tukar Blob kepada Base64 untuk dihantar ke Apps Script
        const reader = new FileReader();
        reader.readAsDataURL(blob);
        reader.onloadend = async function() {
            const base64data = reader.result.split(',')[1];
            
            // URL Web App yang anda dapat dari Google Apps Script
            const scriptUrl = "https://script.google.com/macros/s/AKfycbwDCV_Ozyp7bPD3K4C86JEuzWUMsg3M3oxYsNdcBH-rYuQIRVRcjFa8BVYGNYJ0K9gV4w/exec"; 
            
            // 4. Hantar ke Google Drive
            const response = await fetch(scriptUrl, {
                method: 'POST',
                mode: 'no-cors', // Penting untuk mengelakkan ralat CORS
                headers: { 'Content-Type': 'text/plain' },
                body: JSON.stringify({
                    base64: base64data,
                    fileName: programName + ".pdf"
                })
            });

            alert("Tahniah! Laporan PDF anda telah selamat disimpan ke Google Drive.");
        };
    } catch (error) {
        console.error("Ralat:", error);
        alert("Gagal menghantar ke Drive. Pastikan internet stabil.");
    }
}


